  input: 'TEXT,F3A,,"In regards to employer/occupation information:  all of our original
    campaign solicitations for contributions included conspicuous requests for required
    information.  For those donors who did not fill in the proper information, we
    have and will continue to gather that information and will continue to update
    our FEC filings accordingly.  The latest amendment constitutes a large amount
    of that new disclosure information.  Also, the additional details, such as interest
    rate, that have been requested regarding the 40,000 dollar loan have been included
    now on previous amendments.  Finally, the 48 hour notice issue arises from a technical
    error on our side.  A duplicate entry was entered for Douglas Nielsen and Douglas
    Nielson after the original 48 hour notice.  This is the same person and he only
    gave $1000 once - as originally correctly reported in the 48 hour notice on 10/20/2002."'
